【商品説明】<BR>
☆ダブルステッチはデザインだけでなく耐久性アップ！<BR>
☆フロントシートにはバックポケット付き！<BR>
☆難燃抗菌仕様<BR>
☆価格からは想像できないクオリティとギャザーデザイン！<BR>
☆カラー：ブラック／アイボリー<BR><BR>

【適合車種】<BR>
トヨタ プリウス<BR><BR>

【適合年式】<BR>
H21/5～H23/11<BR><BR>

【適合型式】<BR>
ZVW30<BR><BR>
【適合グレード】<BR>
S/Sツーリングセレクション<BR>
S-LEDエディション<BR>
G/Gツーリングセレクション<BR>
リアシートアームレスト有り車<BR><BR>

【仕様】<BR>
レーザーパッケージには装着出来ません。<BR>
コンソールカバーは付属しておりません。<BR><BR>

【カラー】<BR>
ブラック／アイボリー<BR><br>

新品　1台分<BR>
PVCレザー<BR>
製造国：中国<BR><BR>
★欠品の際は1ヶ月半～2ヶ月程お待ち頂く場合があります。★<BR><BR>

※北海道及び離島などの中継地域は別途料金が掛かります。<BR>
※沖縄県のみ送料着払い。<BR>
※代引きの場合は代引手数料別途となります。<BR><br>







