【AWESOME/オーサム】オリジナル 純正G's風シートカバー<br>
標準のシートに取り付けるだけで、<br>
純正G's仕様に早変わり！<br><br>

【適合】<br>
車種：トヨタ　ハリアー（ハイブリッド含む）<br>
型式：ZSU60W / ZSU65W<br>
年式：H25.12～<br>
乗車定員：5人<br>
グレード：PREMIUM“Advanced Package” / PREMIUM / ELEGANCE<br>
コンビシート、1列目：運転席パワーシート<br />
※快適温熱シート（オプション）対応
<br><br>

【セット内容】<br>
・運転席・助手席シート<br>
・リアシート<br>
・ヘッドレスト　5点<br>
・1列目肘置×1点<br>
・2列目肘置×1点<br>
<br>
【不適合】<br>
本革シート車、ファブリックシート車<br />
1列目運転席手動シート<br>
1列目助手席パワーシート<br><br>

【ご注意】<br>
こちらの商品は納期が１ヶ月～１ヶ月半かかります。<br>
お急ぎの方は事前にお問い合わせ下さい。<br>
受注生産のため、代引きは不可となります。<br><br>
※北海道・沖縄・離島の送料につきましては、別途お見積りとなります。<br>







