【商品説明】<BR>
■背の部分は通気性を高めたパンチング加工を施しています。<BR>
■シートカバーの強度と高級感を演出するダブルステッチ仕様。<BR>
■不意のタバコ落下にも安心の難燃PVCレザー採用で<BR>
　 シートを傷めません。<BR>
■お子様にも安心の防水PVCレザー採用で<BR>
　 拭き取りもらくらくです。<BR><BR>

