ヘッドレストに簡単取付！！<br>
ヘッドレストフック 2個セット（全7色）<br>
コの字型<br><br>

【サイズ】<br>
・高さ：約1～2.5cm<br>
・長さ：約10cm<br>
・幅：約2～4.5cm<br><br>

【セット内容】<br>
ヘッドレストフック×2個セット<br><br>

【商品説明】<br>
工具不要で取り付け簡単！<br>
バッグ、ハンガー、買物袋、傘などを掛けられてとても便利です。<br>
ヘッドレストにカチッとはめ込むだけで使用可能です。<br>
角度調節が可能なため、使わないときはスッキリ収納できます。<br><br>

※過重量のものをかけないで下さい。<br>
※用途以外の使用又は加工はしないで下さい。<br>
※本製品の取付け取外し、ご使用における事故・破損・損害につきましては、弊社は一切の責任を負いかねますので予めご了承ください。<br><br><br>







